import React from "react";
import { AccountCircle, Lock, LockOpen } from "@material-ui/icons";
import { CircleMenu, CircleMenuItem } from "react-circular-menu";
import { Button } from "@material-ui/core";
import { Link } from "react-router-dom";

import { connect } from "react-redux";
import PropTypes from "prop-types";
import { logout } from "../store/actions/auth";
import { ToggleButton } from "react-bootstrap";

const NavRight = ({ auth: { isAuthenticated, loading }, logout }) => {
	const authLinks = (
		<CircleMenuItem
			tooltip='Logout'
			className='menu-item'
			tooltipPlacement='bottom'
			onClick={logout}
		>
			<Button>
				<Link exact to='/'>
					<Lock color='secondary' fontSize='large' />
				</Link>
			</Button>
		</CircleMenuItem>
	);
	const guestLinks = (
		<CircleMenuItem tooltip='Login' className='menu-item' tooltipPlacement='left'>
			<Button>
				<Link exact to='/login'>
					<LockOpen color='secondary' fontSize='large' />
				</Link>
			</Button>
		</CircleMenuItem>
	);
	return (
		<div className='circular-nav-right'>
			<CircleMenu
				startAngle={120}
				rotationAngle={130}
				itemSize={3}
				radius={5}
				menuToggleClassName='toggle-menu'
				rotationAngleInclusive={false}
			>
				{!loading && isAuthenticated ? authLinks : guestLinks}
				<ToggleButton
					tooltip='Profile'
					tooltipPlacement='left'
					className='menu-item'
				></ToggleButton>
					<Button>
						<Link exact to='/profile'>
							<AccountCircle color='secondary' fontSize='large' />
						</Link>
					</Button>

			</CircleMenu>
		</div>
	);
};

NavRight.propTypes = {
	logout: PropTypes.func.isRequired,
	auth: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
	auth: state.auth,
});

export default connect(mapStateToProps, { logout })(NavRight);
